public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + ((getAttributePrefix() == null) ? 0
      : getAttributePrefix().hashCode());
  result = prime * result
      + ((getAttributeName() == null) ? 0 : getAttributeName().hashCode());
  return result;
}
